import React from 'react';
import './PageTable.css';
import FolderIcon from './FolderIcon';
import PageIcon from './PageIcon';

const PageTable = ({ pages }) => (
  <div className="page-table">
    <h2>Страницы проекта</h2>
    <table>
      <thead>
        <tr>
          <th>Тип</th>
          <th>Заголовок</th>
          <th>Дата изменений</th>
          <th>Ссылка</th>
        </tr>
      </thead>
      <tbody>
        {pages.map(page => (
          <tr key={page.id}>
            <td>{page.is_folder ? <FolderIcon /> : <PageIcon thumbnail={page.thumbnail} />}</td>
            <td>{page.title}</td>
            <td>{page.lastmod}</td>
            <td><a href={page.url} target="_blank" rel="noopener noreferrer">Открыть</a></td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);

export default PageTable;
